dnf(sumo_1195,axiom_p,documentation('PhysicalQuantity','EnglishLanguage','A &%PhysicalQuantity is a measure of some quantifiable aspect of the modeled world, such as the earths diameter (a constant length) and the stress in a loaded deformable solid (a measure of stress, which is a function of three spatial coordinates). Every &%PhysicalQuantity is either a &%ConstantQuantity or &%FunctionQuantity. Instances of &%ConstantQuantity are dependent on a &%UnitOfMeasure, while instances of &%FunctionQuantity are &%Functions that map instances of &%ConstantQuantity to other instances of &%ConstantQuantity (e.g., a &%TimeDependentQuantity is a &%FunctionQuantity). Although the name and definition of &%PhysicalQuantity is borrowed from physics, a &%PhysicalQuantity need not be material. Aside from the dimensions of length, time, velocity, etc., nonphysical dimensions such as currency are also possible. Accordingly, amounts of money would be instances of &%PhysicalQuantity. A &%PhysicalQuantity is distinguished from a pure &%tMathmaticalQuant by the fact that the former is associated with a dimension of measurement.'),g).
dnf(sumo_1196,axiom_p,subclass('ConstantQuantity','PhysicalQuantity'),g).
dnf(sumo_1197,axiom_p,documentation('ConstantQuantity','EnglishLanguage','A &%ConstantQuantity is a &%PhysicalQuantity that has a constant value, e.g. 3 &%Meters and 5 &%HourDurations. The magnitude (see &%MagnitudeFn) of every &%ConstantQuantity is a &%tNumber. &%ConstantQuantity is distinguished from &%FunctionQuantity, in that each isa of the latter is formed through the mapping of one &%PhysicalQuantity to another &%PhysicalQuantity. Each isa of &%ConstantQuantity is expressed with the &%BinaryFunction &%MeasureFn, which takes a &%tMathmaticalQuant and a &%UnitOfMeasure as arguments. For example, 3 &%Meters is expressed as (&%MeasureFn 3 &%Meter). Instances of &%ConstantQuantity form a partial order (see &%PartialOrderingRelation) with the &%lessThan relation, since &%lessThan is a &%RelationExtendedToQuantities and &%lessThan is defined over the &%RealNumbers. The &%lessThan relation is not a total order (see &%TotalOrderingRelation) over the class &%ConstantQuantity since elements of some subclasses of &%ConstantQuantity (such as length quantities) are incomparable to elements of other subclasses of &%ConstantQuantity (such as mass quantities).'),g).
