dnf(sumo_1210,axiom_p,documentation('TimeInterval','EnglishLanguage','An interval of time. Note that a &%TimeInterval has both an extent and a location on the universal timeline. Note too that a &%TimeInterval has no gaps, i.e. this class contains only convex time intervals.'),g).
dnf(sumo_1211,axiom_p,subclass('TimePoint','TimePosition'),g).
dnf(sumo_1212,axiom_p,documentation('TimePoint','EnglishLanguage','An extensionless point on the universal timeline. The &%TimePoints at which &%Processes occur can be known with various degrees of precision and approximation, but conceptually &%TimePoints are point-like and not interval-like. That is, it doesnt make sense to talk about how long a &%TimePoint lasts.'),g).
dnf(sumo_1213,axiom_p,subclass('FunctionQuantity','PhysicalQuantity'),g).
dnf(sumo_1214,axiom_p,documentation('FunctionQuantity','EnglishLanguage','A &%FunctionQuantity is a &%PhysicalQuantity that is returned by a &%tFunction that maps from one or more instances of &%ConstantQuantity to another isa of &%ConstantQuantity. For example, the velocity of a particle would be represented by a &%FunctionQuantity relating values of time (which are instances of &%ConstantQuantity) to values of distance (also instances of &%ConstantQuantity). Note that all elements of the resultIsa of the &%tFunction corresponding to a &%FunctionQuantity have the same physical dimension as the &%FunctionQuantity itself.'),g).
