dnf(sumo_1216,axiom_p,documentation('UnaryConstantFunctionQuantity','EnglishLanguage','A &%subclass of &%FunctionQuantity, instances of which are returned by &%UnaryFunctions that map from one isa of the &%Class &%ConstantQuantity to another isa of the &%Class &%ConstantQuantity.'),g).
