dnf(sumo_1226,axiom_p,documentation('Class','EnglishLanguage','&%Classes differ from &%Sets in three important respects. First, &%Classes are not assumed to be extensional. That is, distinct &%Classes might well have exactly the same instances. Second, &%Classes typically have an associated `condition that determines the instances of the &%Class. So, for example, the condition `human determines the &%Class of &%Humans. Note that some &%Classes might satisfy their own condition (e.g., the &%Class of &%Abstract things is &%Abstract) and hence be instances of themselves. Third, the instances of a class may occur only once within the class, i.e. a class cannot contain duplicate instances.'),g).
dnf(sumo_1227,axiom_p,subclass('Set','tCol'),g).
dnf(sumo_1228,axiom_p,isa('Set','tCol'),g).
dnf(sumo_1229,axiom_p,documentation('Set','EnglishLanguage','A &%tCol that satisfies extensionality as well as other constraints specified by some choice of set theory. &%Sets differ from &%Classes in two important respects. First, &%Sets are extensional - two &%Sets with the same &%elements are identical. Second, a &%Set can be an arbitrary stock of objects. That is, there is no requirement that &%Sets have an associated condition that determines their membership. Note that &%Sets are not assumed to be unique sets, i.e. &%elements of a &%Set may occur more than once in the &%Set.'),g).
