dnf(sumo_4603,axiom_p,documentation(hasPurpose,'EnglishLanguage','This &%tPredicate expresses the concept of a conventional goal, i.e. a goal with a neutralized agents intention. Accordingly, (&%hasPurpose ?THING ?FORMULA) means that the isa of &%tTemporalThing ?THING has, as its purpose, the &%Proposition expressed by ?FORMULA. Note that there is an important difference in meaning between the &%Predicates &%hasPurpose and &%result. Although the second argument of the latter can satisfy the second argument of the former, a conventional goal is an expected and desired outcome, while a result may be neither expected nor desired. For example, a machine process may have outcomes but no goals, aimless wandering may have an outcome but no goal, a learning process may have goals with no outcomes, and so on.'),g).
