dnf(sumo_5751,axiom_p,documentation('KelvinDegree','EnglishLanguage','SI &%UnitOfMeasure used with &%MeasureFn to produce terms denoting instances of &%TemperatureMeasure. Symbol: K. It is one of the base units in SI (it is also a unit in the ITS system). Kelvin differs from the Celsius scale in that the triple point of water is defined to be 273.16 &%KelvinDegrees while it is 0 &%CelsiusDegrees. The magnitudes of intervals in the two scales are the same. By definition the conversion constant is 273.15.'),g).
dnf(sumo_5752,axiom_p,isa('Mole','UnitOfMass'),g).
dnf(sumo_5753,axiom_p,isa('Mole','SystemeInternationalUnit'),g).
dnf(sumo_5754,axiom_p,documentation('Mole','EnglishLanguage','SI amount of substance unit. symbol: mol. It is one of the base units in SI. It is defined as follows: the &%Mole is the amount of substance of a system which contains as many elementary entities as there are atoms in 0.012 &%Kilograms of carbon 12. Note that, when this &%UnitOfMeasure is used, the elementary entities must be specified - they may be atoms, molecules, ions, electrons, etc. or groups of such particles.'),g).
dnf(sumo_5755,axiom_p,isa('Candela','CompositeUnitOfMeasure'),g).
dnf(sumo_5756,axiom_p,isa('Candela','SystemeInternationalUnit'),g).
dnf(sumo_5757,axiom_p,documentation('Candela','EnglishLanguage','SI luminosity intensity measure. Symbol: cd. It is one of the base units in SI, and it is currently defined as follows: the &%Candela is the luminous intensity, in a given direction, of a source that emits monochromatic radiation of frequency 540*10^12 &%Hertz and that has a radiant intensity in that direction of 1/683 &%Watt per &%Steradian.'),g).
dnf(sumo_5758,axiom_p,isa('Liter','UnitOfVolume'),g).
dnf(sumo_5759,axiom_p,documentation('Liter','EnglishLanguage','Unit of volume in the metric system. It is currently defined to be equal to one cubic decimeter (0.001 cubic meter). Symbol: l.'),g).
dnf(sumo_5760,axiom_p,isa('Centimeter','UnitOfLength'),g).
dnf(sumo_5761,axiom_p,documentation('Centimeter','EnglishLanguage','Submultiple of &%Meter. Symbol: cm. It is the 100th part of a &%Meter'),g).
