dnf(sumo_5763,axiom_p,documentation('Millimeter','EnglishLanguage','Submultiple of Meter. Symbol: mm. A millimeter is the 1000th part of a meter'),g).
dnf(sumo_5764,axiom_p,isa('Millimeter','UnitOfLength'),g).
dnf(sumo_5765,axiom_n,isa(A,'tNumber'),A='MultFn'(1,A),- ('MeasureFn'(A,'Millimeter')='MeasureFn'('MultFn'(A,0.001),'Meter')),n).
dnf(sumo_5766,axiom_p,isa('Kilometer','UnitOfLength'),g).
dnf(sumo_5767,axiom_p,documentation('Kilometer','EnglishLanguage','Supermultiple of &%Meter. Symbol: km. A &%Meter is the 1000th part of a &%Kilometer'),g).
