dnf(sumo_5770,axiom_p,isa('Radian','SystemeInternationalUnit'),g).
dnf(sumo_5771,axiom_p,documentation('Radian','EnglishLanguage','SI plane angle measure. Symbol: rad. It is the angle of a circle subtended by an arc equal in length to the circles radius. Another definition is: the plane angle between two radii of a circle which cut off on the circumference an arc equal in length to the radius. &%Radian = m/m = 1.'),g).
dnf(sumo_5772,axiom_p,isa('Steradian','UnitOfAngularMeasure'),g).
dnf(sumo_5773,axiom_p,isa('Steradian','SystemeInternationalUnit'),g).
dnf(sumo_5774,axiom_p,documentation('Steradian','EnglishLanguage','SI solid angle measure. Symbol: sr. It is the solid angle of a sphere subtended by a portion of the surface whose area is equal to the square of the spheres radius. Another definition is: the solid angle which, having its vertex in the center of the sphere, cuts off an area of the surface of the sphere equal to that of a square with sides of length equal to the radius of the sphere. &%Steradian = m^2/m^2 = 1.'),g).
dnf(sumo_5775,axiom_p,subclass('FrequencyMeasure','TimeDependentQuantity'),g).
dnf(sumo_5776,axiom_p,isa('FrequencyMeasure','tCol'),g).
dnf(sumo_5777,axiom_p,documentation('FrequencyMeasure','EnglishLanguage','A &%subclass of &%TimeDependentQuantity, instances of which are measures of the frequency with which some &%tEventProcess occurs.'),g).
dnf(sumo_5778,axiom_p,subclass('UnitOfFrequency','CompositeUnitOfMeasure'),g).
