dnf(sumo_5783,axiom_p,isa('Hertz','SystemeInternationalUnit'),g).
dnf(sumo_5784,axiom_p,documentation('Hertz','EnglishLanguage','SI frequency measure. Symbol: Hz. It is the number of cycles per second. &%Hertz = s^(-1). Note that &%Hertz does not have a conversion function.'),g).
dnf(sumo_5785,axiom_p,isa('Newton','CompositeUnitOfMeasure'),g).
dnf(sumo_5786,axiom_p,isa('Newton','SystemeInternationalUnit'),g).
dnf(sumo_5787,axiom_p,documentation('Newton','EnglishLanguage','SI force measure. Symbol: N. It is that force which gives to a mass of 1 kilogram an acceleration of 1 &%Meter per &%SecondDuration. &%Newton = m*kg*s^(-2).'),g).
dnf(sumo_5788,axiom_p,isa('Pascal','CompositeUnitOfMeasure'),g).
dnf(sumo_5789,axiom_p,isa('Pascal','SystemeInternationalUnit'),g).
dnf(sumo_5790,axiom_p,documentation('Pascal','EnglishLanguage','SI pressure measure. Symbol:Pa. It is the pressure of one &%Newton per square &%Meter. &%Pascal = N/m^2 = m^(-1)*kg*s^(-2).'),g).
dnf(sumo_5791,axiom_p,isa('Joule','CompositeUnitOfMeasure'),g).
dnf(sumo_5792,axiom_p,isa('Joule','SystemeInternationalUnit'),g).
dnf(sumo_5793,axiom_p,documentation('Joule','EnglishLanguage','SI energy measure. Symbol: J. It is the work done when the point of application of 1 &%Newton is displaced a distance of 1 &%Meter in the direction of the force. &%Joule = N*m = m^2*kg*s^(-2).'),g).
dnf(sumo_5794,axiom_p,isa('Watt','CompositeUnitOfMeasure'),g).
dnf(sumo_5795,axiom_p,isa('Watt','SystemeInternationalUnit'),g).
dnf(sumo_5796,axiom_p,documentation('Watt','EnglishLanguage','SI power measure. Symbol: W. A &%UnitOfMeasure that measures power, i.e. energy produced or expended divided by &%TimeDuration. It is the power which gives rise to the production of energy (or work) at the rate of one &%Joule per &%SecondDuration. &%Watt = J/s = m^2*kg*s^(-3).'),g).
dnf(sumo_5797,axiom_p,isa('Horsepower','CompositeUnitOfMeasure'),g).
