dnf(sumo_5801,axiom_p,isa('Coulomb','SystemeInternationalUnit'),g).
dnf(sumo_5802,axiom_p,documentation('Coulomb','EnglishLanguage','SI electric charge measure. Symbol: C. It is the quantity of electric charge transported through a cross section of a conductor in an electric circuit during each &%SecondDuration by a current of 1 &%Ampere. Coulomb = s*A.'),g).
dnf(sumo_5803,axiom_n,isa(A,'tNumber'),B='MeasureFn'(A,'Coulomb'),-isa(B,'TimeDependentQuantity'),n).
dnf(sumo_5804,axiom_p,isa('Volt','CompositeUnitOfMeasure'),g).
dnf(sumo_5805,axiom_p,isa('Volt','SystemeInternationalUnit'),g).
dnf(sumo_5806,axiom_p,documentation('Volt','EnglishLanguage','SI electric potential measure. Symbol: V. It is the difference of electric potential between two points of a conducting wire carrying a constant current of 1 &%Ampere, when the power dissipated between these points is equal to 1 &%Watt. &%Volt = W/A = m^2*kg*s^(-3)*A^(-1).'),g).
dnf(sumo_5807,axiom_p,isa('Farad','CompositeUnitOfMeasure'),g).
dnf(sumo_5808,axiom_p,isa('Farad','SystemeInternationalUnit'),g).
dnf(sumo_5809,axiom_p,documentation('Farad','EnglishLanguage','SI capacitance measure. Symbol: F. It is the capacitance of a capacitator between the plates of which there appears a difference of potential of 1 &%Volt when it is charged by a quantity of electricity equal to 1 Coulomb. &%Farad = C/V = m^(-2)*kg(-1)*s^4*A^2.'),g).
dnf(sumo_5810,axiom_p,isa('Ohm','CompositeUnitOfMeasure'),g).
dnf(sumo_5811,axiom_p,isa('Ohm','SystemeInternationalUnit'),g).
dnf(sumo_5812,axiom_p,documentation('Ohm','EnglishLanguage','SI electric resistance measure. It is the electric resistance between two points of a conductor when a constant difference of potential of 1 &%Volt, applied between these two points, produces in this conductor a current of 1 &%Ampere, this conductor not being the force of any electromotive force. &%Ohm = V/A = m^2*kg*s^(-3)*A^(-2).'),g).
dnf(sumo_5813,axiom_p,isa('Siemens','CompositeUnitOfMeasure'),g).
dnf(sumo_5814,axiom_p,isa('Siemens','SystemeInternationalUnit'),g).
dnf(sumo_5815,axiom_p,documentation('Siemens','EnglishLanguage','SI electric conductance measure. Symbol: S. In the case of direct current, the conductance in &%Siemens is the reciprocal of the resistance in &%Ohms, in the case of alternating current, it is the reciprocal of the impedance in ohms. siemens = A/V = m^(-2)*kg(-1)*s^(3)*A^2.'),g).
dnf(sumo_5816,axiom_p,isa('Weber','CompositeUnitOfMeasure'),g).
dnf(sumo_5817,axiom_p,isa('Weber','SystemeInternationalUnit'),g).
dnf(sumo_5818,axiom_p,documentation('Weber','EnglishLanguage','SI magnetic flux measure. Symbol: Wb. It is the magnetic flux which, linking a circuit of one turn, produces in it an electromotive force of 1 &%Volt as it is reduced to zero at a uniform rate in 1 &%SecondDuration. &%Weber = V*s = m^2*kg*s^(-2)*A^(-1).'),g).
dnf(sumo_5819,axiom_p,isa('Tesla','CompositeUnitOfMeasure'),g).
dnf(sumo_5820,axiom_p,isa('Tesla','SystemeInternationalUnit'),g).
dnf(sumo_5821,axiom_p,documentation('Tesla','EnglishLanguage','SI magnetic flux density measure. Symbol: T. One &%Tesla equals one &%Weber per square &%Meter. &%Tesla = Wb/m^2 = kg*s^(-2)*A^(-1).'),g).
dnf(sumo_5822,axiom_p,isa('Henry','CompositeUnitOfMeasure'),g).
dnf(sumo_5823,axiom_p,isa('Henry','SystemeInternationalUnit'),g).
dnf(sumo_5824,axiom_p,documentation('Henry','EnglishLanguage','SI inductance measure. Symbol: H. One &%Henry is equivalent to one &%Volt divided by one &%Ampere per &%SecondDuration. If a current changing at the rate of one &%Ampere per &%SecondDuration induces an electromotive force of one &%Volt, the circuit has an inductance of one &%Henry. &%Henry = Wb/A = m^2*kg*s^(-2)*A^(-2).'),g).
