dnf(sumo_5834,axiom_p,documentation('Lumen','EnglishLanguage','SI luminous flux measure. Symbol: lm. It is the amount streaming outward through one solid angle of 1 &%Steradian from a uniform point source having an intensity of one &%Candela. &%Lumen = cd*sr = cd * 1.'),g).
dnf(sumo_5835,axiom_p,isa('Lux','CompositeUnitOfMeasure'),g).
dnf(sumo_5836,axiom_p,isa('Lux','SystemeInternationalUnit'),g).
dnf(sumo_5837,axiom_p,documentation('Lux','EnglishLanguage','SI illuminance measure. Symbol: lx. It is the amount of illumination provided when one &%Lumen is evenly distributed over an area of 1 square &%Meter. This is also equivalent to the illumination that would exist on a surface all points of which are one &%Meter from a point source of one &%Candela. &%Lux = lm/m^2 = m^(-2)*cd.'),g).
