dnf(sumo_5840,axiom_p,documentation('Becquerel','EnglishLanguage','SI activity measure. Symbol: Bq. It measures the amount of radioactivity contained in a given sample of matter. It is that quantity of a radioactive element in which there is one atomic disintegration per &%SecondDuration. &%Becquerel = s^(-1).'),g).
