dnf(sumo_18169,axiom_p,documentation('Knife','EnglishLanguage','A sharp object used for cutting. The object must have at least single blade or major protrusion which may be sharp at its end as well. It may be sharp on both sides, or just one. Unlike an awl it has a sharp edge rather than a point. Unlike scissors, it is a single blade without additional articulated parts. Unlike an axe, a knife is well-designed for slicing rather than chopping, although a heavy knife such as a broadsword can also be used for chopping, whereas a non-knife is not well designed for slicing meat for example. A knife can be small like a pocket knife, or large like a two-handed broadsword. A knife may also include other protrusions such as in the split swords and trident-like objects (that also possess a long sharp edge) in Chinese weaponry.'),g).
